inline unsigned char escaped_char(unsigned char c)
{
  switch (c)
  {
    case 'b':
      return '\b';
    case 'f':
      return '\f';
    case 'n':
      return '\n';
    case 'r':
      return '\r';
    case 't':
      return '\t';
    default:
      return c;
  }
}

/* quote_type: 0 - single quotes; 1 - double quotation marks */
int64_t parse_string(const char* src, char* dest, int64_t len, int quote_type)
{
  int64_t i;
  int64_t index = 0;
  for(i = 0; i < len; ++i)
  {
    unsigned char c = src[i];
    if(c == '\\')
    {
      if (i < len - 1)
      {
        c = src[++i];
      }
      else
      {
        break;
      }
      c = escaped_char(c);
    }
    else if (quote_type == 0 && c == '\'' && i + 1 < len && src[i + 1] == '\'')
    {
      ++i;
    }
    else if (quote_type == 1 && c == '"' && i + 1 < len && src[i + 1] == '"')
    {
      ++i;
    }
    dest[index++] = c;
  }
  assert(index <= len);
  dest[index] = '\0';
  return index;
}

int64_t parse_binary(const char* src, char* dest, int64_t len)
{
  int64_t i;
  int64_t index = 0;
  for(i = 0; i < len; i += 2)
  {
    char buf[3];
    buf[0] = src[i];
    buf[1] = src[i+1];
    buf[2] = 0;
    unsigned char a = strtol(buf,0, 16);
    dest[index++] = (char)a;
  }
  return index;
}

char* str_tolower(char *buff)
{
  if (buff)
  {
    char  *ptr = buff;
    unsigned char ch = *ptr;
    while (*ptr)
    {
      ch = *ptr;
      if (ch >= 'A' && ch <= 'Z')
        ch += 'a' - 'A';
      else if (ch >= 0x80 && isupper(ch))
        ch = tolower(ch);
      *ptr = ch;
      ptr++;
    }
  }
  return buff;
}

